description:
Ending is a single player turn based puzzle game about movement and death.
Recommended for people who like board games, chess and roguelikes.

What's New:

Various UI bugs have been fixed.
A severe gameplay bug with generators has been solved (this required a change to some levels - however the new behaviour is consistent instead of sometimes random).
Rolled back game saves to use Flash SharedObject instead of document files - this is because various Android devices refused to allow data to be saved in this manner. I tried for consistency and lack of crashes but your phones don't like each other. Sorry. Enjoy your fragmentation guys :(

